svg.script:
		function Speak(msg){
			if ('speechSynthesis' in window) {
				let u = new SpeechSynthesisUtterance(msg);
				u.rate = 1.1;
				u.lang = "de-DE";
				window.speechSynthesis.speak(u);
			} else {
				console.error("Browser not supported!!!");
            }
		}
		if ('speechSynthesis' in window) {

		} else {
            alert("Bitte einen anderen Browser nutzten!!");
        }
		setTimeout(function(){
			Speak("Diese Animation wurde nur mit einem Text-Editor erstellt!");	
		}, 500);
		setTimeout(function(){			
			Speak("Heute geht es um die Essigsure.");
			Speak("Zunchst einmal die Definition der wichtigsten Begriffe.");
			Speak("Der Eisessig ist chemisch gesehen reine Essigsure. Er ist ein farbloser Stoff mit einem stechenden Geruch. Er verdampft bei einer Temperatur von 118 C und schmiltzt ab 16,5C.");
			Speak("Da er im gefrohrenen Zustand wie Eis aus sieht, wird er auch Eisessig genannt!");

			Speak("Die Essigsure ist ein Rein-Stoff, deren Summenformel CH3, C O O H lautet. Nheres zu Aufbau und Eigenschaften spter...");

			Speak('Der Begriff "Essig" ist gesetzlich definiert und meint eine Essigsure-Lsung mit einem typischen Essigsure-Anteil von 5 bis 6%. Maximal 15,5%. Er ist zum Verzehr geeignet.');

			Speak('Hier noch einmal die Eigenschaften der Essigsure aufgelistet:');
			Speak('Doch warum sind Siede und Schmelztemperatur im Vergleich zu Propan-1-ol und Propanal so hoch?');

			Speak('Schauen wir uns den Aufbauer der Essigsure doch etwas genauer an:');
			Speak('Die Funktionelle-Gruppe der Essigsure ist die stark polare Carboxylgruppe.');
			Speak('Mit ihrer Hilfe knnen 2 Wasserstoff-Brcken zwischen 2 Moleklen entstehen.');

			Speak('Im Vergleich dazu das Propan-1-ol Molekl. Es hat weder start polarisierte H-Atome, noch geignete freie Elektronenparre um eine starke Bindung mit Hilfe von H-Brcken einzugehen.');
			Speak("Da man beim Wechsel in einen energie-reicheren Aggregats-zustand mehr Energie zu fhren muss, ist die Siedetemperatur der Essigsure deutlich hher.");

			Speak("Gibt man Essigsure in Wasser entstehen 3 Arten von Ionen. Die positiv geladenen Kathionen (Hier die Oxonium-Ionen) werden von der negativ geladenen Kathode angezogen. Hier nehmen sie ein Elektron auf und werden so wieder neutral. Die negativ geladenen Anionen (hier die Sure-Rest-Ionen Azetat und Ethanoat-Ion) wandern zur positiven Anode. Hier geben sie ein Elektron ab. Auch sie werden so neutral. Bewegte Ladungen (hier Elektronen) kennzeichnen einen Stromfluss. Die Lsung leitet also den elektrischen Strom!");

			Speak("Die Essigsure ist eine schwache Sure, da sie in Lsung nur teilweise protolysiert vorliegt, also nicht alle Molekhle zu Oxonium und Sure-Rest-Ion reagieren. Dadurch liegen relativ wenige Oxonium-Ionen in der Lsung vor.");

			Speak("Die Essigsure eignet sich wunderbar zum Reinigen, da sie mit dem Kalk zu lslichem Calziumacetat und Kohlensure reagiert. So entfernt sie den Kalk. Die Kohlensure zerfllt sofort zu C O 2 und Wasser.");

			Speak("Die Essigsure reagiert auch mit unedlen Metallen. Als Beispiel nehmen wir die Reaktion mit Magnesium.");
			Speak("Dieses reagiert mit der Essigsure zu Magnesiumacetat und Wasserstoff.");

            Speak("Hier noch eine Liste mit blichen Verwendungszwecken von Essigsure.");
		}, 5000);
